import usePages from '../data/usePages'

import { useLocation } from "react-router-dom"

var pageNotNull = [];
var pageUri = '';
const Home = () => {
    const location = useLocation();
    const pages = usePages();
    const location_path = location.pathname;

    if (pages !== null) {
        pages.map( item => (
          pageNotNull = item
        ))
        pageNotNull.map( item => (
            pageUri = item.uri
        ))
    }
    console.log(pageUri);
}

export default Home
